import React from "react";
import Arr from "./new"

function Main(){
    return (
        <>
           <div className = "container">
               <img src = {Arr[0].img1}/>
               <div>
                   <span>{ Arr[0].id }</span>
                   <h1>{Arr[0].model}</h1>
                   <hr></hr>
                   <p>features</p>
               </div>
            </div> 
        </>
        )
    }

export default Main;
